Since this is a component used in different places but don't have a scope context and are therefore isolated from itself.

## The Solution

To solve this problem, we can use React Context to create a global state for the Tooltip component. This will allow us to keep track of the currently open Tooltip and close it when a new one is opened.

Here's how we can implement this solution:

1. Create a new file called `TooltipContext.js` in the `context` folder.

```javascript
import React, { createContext, useState } from 'react';

export const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [openTooltip, setOpenTooltip] = useState(null);

  const closeTooltip = () => {
    setOpenTooltip(null);
  };

  const openTooltipHandler = (id) => {
    if (openTooltip === id) {
      closeTooltip();
    } else {
      setOpenTooltip(id);
      closeTooltip();
    }
  };

  return (
    <TooltipContext.Provider value={{ openTooltipHandler, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};
```

