The `closeTooltip` function sets the `openTooltip` state to `null`, which closes the currently open Tooltip.

The `openTooltipHandler` function takes an `id` as a parameter and opens the Tooltip with that `id`. If the Tooltip with that `id` is already open, it closes it.

